import styled from "styled-components";

function SectionProject() {
  render();
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };

  return (
    <Container>
      <Wrap>
        <TextBanner>
          <TextMain>KEEP GOING</TextMain>
          <TextWhite>KEEP GOING</TextWhite>
          <TextMain>KEEP GOING</TextMain>
          <TextWhite>KEEP GOING</TextWhite>
          <TextMain>KEEP GOING</TextMain>
          <TextWhite>KEEP GOING</TextWhite>
        </TextBanner>
      </Wrap>
    </Container>
  );
}

export default SectionProject;

const Container = styled.div`
  width: 100%;
  position: relative;
`;

const Wrap = styled.div`
  width: 100%;
`;

const TextBanner = styled.ul`
  width: 1010px;
`;

const TextMain = styled.li`
  margin: 40px 70px;
  font-weight: ${({ theme }) => theme.fonts.weightExtra};
  font-size: 110px;
`;

const TextWhite = styled.li`
  margin: 40px 70px;
  font-weight: ${({ theme }) => theme.fonts.weightExtra};
  font-size: 110px;
`;
